import React, { Component } from "react";
import { Router, Switch, Route } from "react-router-dom";


import Home from "./src/comp/Home";


export default class Routes extends Component {
    render() {
        return (
            <Router>
                <Switch>
                    <Route path="/" exact component={Home} />

                </Switch>
            </Router>
        )
    }
}
